import React from 'react';
import Products from '../Products/Products';
import CartTotal from '../CartTotal/CartTotal';

const Cart = ({cart}) => {
    const cartStyles = {
        display: 'flex',
        width: '100vw',
    }
    return (
        <div style={cartStyles}>
            <Products products={cart}></Products>
            <CartTotal></CartTotal>
        </div>
    );
};

export default Cart;
